import { Image, Pressable, Text, View } from "react-native";

const MealItem = ({ title }) => {
  return (
    <View>
      <Pressable>
        <View>
          <Image />
          <Text>{title}</Text>
        </View>
      </Pressable>
    </View>
  );
};

export default MealItem;
